import React from "react";
import { ReactElement } from "react";
import Button from "../Button.tsx";

let NewWorkout = (): ReactElement => {

  const num = 4;
  const speed = 40;
  return (
    <>
      <div className="caption">Workout Details</div>

      <div className="default-div" style={{ fontSize: "2.5em", textAlign: "start", marginLeft: "1em" }}>
        <div className="default-div">{num} sets</div>
        <div className="default-div">{speed} seconds/set</div>
      </div>

      <div className="flex-row">
        <input></input>
        <Button margin="0em 1em 0em auto" location="/workout-start-0" text="Save" type="thin-rect-button"></Button>
      </div>
      <Button margin="0em 1em 0em auto" location="/" text="Start" type="thin-rect-button"></Button>
    </>
  );
}

export default NewWorkout;
